import gmailLogo from './../images/gmail.png'
import githubLogo from './../images/github.svg'
import facebookLogo from './../images/facebook-logo.jpg'
import pluralsightLogo from './../images/pluralsight.png'


export const bannerState = {
	"authorName": 'Toan Nguyen',
	"logos": [
		{
			"name": 'GitHub',
			"href": 'https://github.com/chris220688',
			"src": githubLogo
		},
		{
			"name": 'Gmail',
			"href": 'mailto: clion2206@gmail.com',
			"src": gmailLogo
		},
		{
			"name": 'Facebook',
			"href": 'https://www.linkedin.com/in/christos-liontos-252b7485',
			"src": facebookLogo
		},
		{
			"name": 'Pluralsight',
			"href": 'https://app.pluralsight.com/profile/christos-liontos',
			"src": pluralsightLogo
		}
	]
};
